css:
.nuclide-ui-message {
  border: 1px solid #060708;
  border-radius: 0;
  margin: 5px;
  padding: 10px;
  border-left-width: 5px;
  line-height: 2;
}
.nuclide-ui-message-default {
  border-color: #aaaaaa;
}
.nuclide-ui-message-error {
  color: #cc3e44;
  border-color: #cc3e44;
}
.nuclide-ui-message-info {
  color: #e37933;
  border-color: #e37933;
}
.nuclide-ui-message-success {
  color: #8dc149;
  border-color: #8dc149;
}
.nuclide-ui-message-warning {
  color: #cbcb41;
  border-color: #cbcb41;
}
